import React from "react";
import {
  LineChart,
  CartesianGrid,
  XAxis,
  YAxis,
  Legend,
  Line,
  Label,
} from "recharts";

export default function Lchart(props) {
  function numtotext(number) {
    let tkufaNum = number;
    let TkufaYear = tkufaNum % 2 === 0 ? tkufaNum / 2 : tkufaNum / 2 + 0.5;
    let tkufainYear = tkufaNum % 2 === 0 ? "2" : "1";
    let yearString = TkufaYear.toString();
    let countD = 0;
    for (let i = 0; i < 4 - yearString.length; i++) countD++;
    let addex = "";
    for (let i = 0; i < countD; i++) addex = addex + "0";
    let finilTkufa = tkufainYear + "." + addex + yearString;
    try {
      return finilTkufa;
    } catch (err) {
      console.log(err);
    }
  }

  let criteria = props.criteria;

  let allDATA = props.allDATA;
  let data = Array.from(allDATA.length);
  debugger;
  for (let i = 0; i < allDATA.length; i++) {
    data[i] = { tkufa: numtotext(allDATA[i].Tkufa), [criteria]: allDATA[i].M1 };
  }

  return (
    <div className={"chartdiv" + (props.isShown ? "show" : "")}>
      <span className="chart">
        <LineChart width={730} height={250} data={data}>
          <CartesianGrid
            horizontal={true}
            vertical={false}
            horizontalPoints={[
              0,
              5 * 33 - 4 * 33,
              6 * 33 - 4 * 33,
              7 * 33 - 4 * 33,
              8 * 33 - 4 * 33,
              9 * 33 - 4 * 33,
            ]}
          />
          <XAxis dataKey="tkufa" padding={{ right: 20, left: 20 }} />
          <YAxis
            type="number"
            domain={[4, 10]}
            padding={{ bottom: 5, top: 5 }}
            height={50}
          >
            <Label value="סולם חיל האוויר" angle={-90} position="insideLift" />
          </YAxis>
          <Legend verticalAlign="bottom" height={36} />
          <Line
            name="ציון מסכם"
            type="monotone"
            dataKey="overGrade"
            stroke="#8884d8"
          />
        </LineChart>
      </span>
    </div>
  );
}
